Order_Date_Year_1_1.query:
q = load "${App.Datasets.Sample_Superstore_with_Goals_tp.FullyQualifiedName}";
q = filter q by date('Order_Date_Year', 'Order_Date_Month', 'Order_Date_Day') in [dateRange([2016,1,2], [2017,12,30])];
result = group q by 'Order_Date_Year';
result = foreach result generate q.'Order_Date_Year' as 'Order_Date_Year', sum(q.'Sales') as 'A';
result = group result by 'Order_Date_Year';
result = foreach result generate 'Order_Date_Year', sum(A) as 'A', (sum(A) - sum(sum(A)) over ([-1..-1] partition by all order by ('Order_Date_Year')))/(sum(sum(A)) over ([-1..-1] partition by all order by ('Order_Date_Year'))) as 'B';
result1 = group result by 'Order_Date_Year';
result1 = foreach result1 generate 'Order_Date_Year' as 'Order_Date_Year', sum('A') as 'A', sum('B') as 'B', (case when sum('B') > 0 then "#4BCA81" else "#E3193B" end) as 'color';
result1 = order result1 by ('Order_Date_Year' desc);
result1 = limit result1 1;
